import { useState } from "react";
import {Link} from "react-router-dom"



export default function Navbar(){
    var x = false;

    if (x === false){
        document.getElementById("container").style.display ="inline-grid"
        document.getElementById("nav").style.width = Screen.availWidth
        document.getElementById("container").style.paddingLeft = 0;
        const navItem = document.querySelectorAll(".navItem")
        navItem.forEach((navItem) => {
            navItem.style.paddingLeft = 0;
            navItem.style.opacity = "1"
            navItem.style.pointerEvents = ""
        })
        
    
        
        x = true;
    }
    else{
        document.getElementById("container").style.display = "flex"
        document.getElementById("container").style.paddingLeft = "20px";
        const navItem = document.querySelectorAll(".navItem")
        navItem.forEach((navItem) => {

            navItem.style.opacity = "0"
            navItem.style.pointerEvents = "none"
        })
        
        x = false;
    }
    
    return(

        <nav class="bg-[#650000] py-2 overflow-hidden flex sticky top-0 z-10 font-high shadow-2xl shadow-black " id="nav">
        
        <ul className="px-5 flex space-x-5" id="container">
            <button className="text-3xl text-white hover:bg-red-700 hover:text-black rounded-xl duration-300 px-2 py-2" id="small" onclick="dropdown()" >
                |||
            </button>
            <a className="navItem text-3xl text-white hover:bg-red-700 tracking-wider hover:text-black rounded-xl duration-300 px-2 py-2" id="a" href="index.html">Home</a>
            <a className="navItem text-3xl text-white hover:bg-red-700 tracking-wider hover:text-black rounded-xl duration-300 px-2 py-2" id="b" href="about.html">About</a>
            
            <a className="navItem text-3xl text-white hover:bg-red-700 tracking-wider hover:text-black rounded-xl duration-300 px-2 py-2" id="c" href="FAQ.html">FAQ</a>
            
            <li className="navItem text-3xl flex text-center" id="d">
                <input type="text" id="search" name="Search..." class="bg-white-200 rounded" placeholder="Type to search" className="px-2 py-2"></input>
                
            </li>
            <button class="navItem text-3xl text-white hover:bg-red-700 hover:text-black rounded-xl duration-300 px-2 py-2" id="e" onclick="searchElement()">
                
                <img src="search.svg" class=" w-10 h-10 text-white"></img>
                
            </button>
            
            </ul>
        </nav>
        
    );
}
